demo.repl.help:
ຄຳສັ່ງທີ່ໃຊ້ໄດ້:
  @show              ─ ສະແດງສະຫຼຸບ adaptive card ລ່າສຸດ
  @json              ─ ສົ່ງອອກຄ່າ JSON ດິບທີ່ໄດ້ຮັບຈາກ flow
  @back              ─ ກັບຄືນໄປຫາ card/inputs ທີ່ຖືກບລັອກກ່ອນໜ້າ
  @input <k>=<v>     ─ ຕັ້ງຄ່າ ຫຼື ແທນທີ່ຟິລດ໌ input
  @click <action_id> ─ ສົ່ງ card ດ້ວຍ action ທີ່ລະບຸ
  @help              ─ ພິມຂໍ້ຄວາມຊ່ວຍເຫຼືອນີ້
  @quit              ─ ອອກຈາກ REPL
